import React from 'react';
import ReactDOM from "react-dom";
import Main from "./Main";
import "./index.css";
import "./commercial/bootstrap/bootstrap.min.css";
import "./commercial/font-awesome/css/all.min.css";

ReactDOM.render(
    <Main/>,
    document.getElementById("root")
);
